import "./index.css";
const style = {
  color: "blue",
  fontSize: "24",
};

function App() {
  return (
    <div className="App">
      <span style={{ color: "red", fontSize: 24 }}>this is span</span>
      <span style={style}>this is span2</span>
      <span className="foo">this is span3</span>
    </div>
  );
}

export default App;
